export class FragmentSignature {
    config;
    log;
    metronome;
    constructor(config, log, metronome) {
        this.config = config;
        this.log = log;
        this.metronome = metronome;
    }
    parse() {
        return {
            type: 'fragmentsignature',
            metronome: this.metronome.parse(),
        };
    }
}
